import React from "react";

function Card(props){
  return(
      <>
        <div className="main">
            <div className='card'>
              <img src={props.imgsrc} alt="series-img" className='cardimg'/>
              <div className="info">
                <span>{props.title}</span>
                <h3>{props.name}</h3>
                <a href={props.reference} target="_blank">
                    <button>Watch Now</button>
                </a>
              </div>  
            </div>
        </div>
        
      </>
  );
}

export default Car;
